import UTDInvoice from '../aggregatedFlows/UTDInvoice';
const RoamingUtdWaybill = {
    name: 'roaming_utd_waybill',
    label: 'Универсальный передаточный документ',
    type: 'roaming',
    aggregatedFlow: UTDInvoice
};
export default RoamingUtdWaybill;
